    showModalPreview: function (consultantCode,consultantUrl) {
                $.ajax({
                headers: {
                    'Accept': 'application/json',
                    'Content-Type': 'application/json'
                },
                url:  ACC.config.encodedContextPath +"/preview/consultant/"+consultantCode,
                type: 'GET',
                success: function(result) {
                    var consultantEnrollment = [{
                        code: result.code,
                        fullName: result.fullName,
                        addressLine: result.addressLine,
                        jobTitle: result.jobTitle,
                        phone: result.phone,
                        consultantEmail: result.consultantEmail,
                        url: consultantUrl,
                        story: result.story,
                        customer: result.customer,
                        profileImageUrl: result.profileImageUrl,
                        contactTime: result.contactTime,
                        gender: result.gender,
                        birthDate: result.birthDate,
                        preferredName: result.preferredName,
                        country: result.country,
                    }];

                $("#appendTemplateModalPreview").empty();

                $("#templateModalPreview").tmpl(consultantEnrollment).appendTo("#appendTemplateModalPreview");
                $("[data-id='modalPreviewReplicatedSite']").modal();
                        var url = "https://static.addtoany.com/menu/page.js";
                        $.getScript( url, function( data ) {
                        });
                $("[data-id='modalPreviewReplicatedSite']").on('hidden.bs.modal', function () {
                    $('.js-preview-sponsor, .js-preview').removeClass('pointer-events--none');
                    $("#appendTemplateModalPreview").empty();
                })
                },
                error: function (xhr, ajaxOptions, thrownError) {
                    console.error(thrownError);
                }
            })
    },

