    getAllProvinces: function() {
        $.ajax({
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json'
            },
            url:  ACC.config.encodedContextPath +"/province?countryIso=" + ACC.config.currentCountry + "&CSRFToken=" + ACC.config.CSRFToken,
            type: 'GET',
            success: function(response) {
        
                if(response && response.length > 0) {
                    $regionSelect = $('.modal-search-consultant__body-ubigeos select[name=regionIso]');
                    $regionSelect
                    .find('option').remove();
                    $regionSelect.find("option").end().append('<option disabled selected>'+ACC.config.defaultOptionDepartment+'</option>');
                    $.each(response, function(item, element)
                    {
                    $regionSelect
                        .find('option')
                        .end()
                        .append('<option value="'+element.isocode+'">'+element.name+'</option>');
                    });      
                    $regionSelect.prop("disabled", false);     
                } else {
                    $(".js-provinceES--select").addClass('hidden');
                    $(".js-provinceES--field").removeClass('hidden');
                }
            },
            error: function () {
                console.error();
            }
        });
    },
